€™s journey converge.  Engineer Steven King told Rolling Stone  in 2003 that Eminem â€œlaid down all three verses in one takeâ€, which Eminem has since shed doubt on .  Eminem stated in his 2008 autobiography, The Way I Am , that he wrote â€œin-between shooting scenes [for 8 Mile ] and taking care of [his] kidsâ€ (pg 108-109.) Scans of the scrawled lyrics on A4 writing pad pages were also featured in the autobiography (pg 217-218.)  In 2014, the demo version appeared on Shady Records' SHADY XV compilation album, which featured the same beat and tone but almost entirely different lyrics.  Commercially, â€œLose Yourselfâ€ was hugely successful and reached #1 in 20 countries, including the US. It marked Eminemâ€™s first US #1, and held the top position for 12 weeks, becoming the third-longest chart-topper from a movie soundtrack (behind â€œI Will Always Love Youâ€ and â€œEnd Of The Roadâ€ ). As of 2022, it is 13x Multi-Platinum in the US.  The song was lauded critically, too. It won two Grammys (Best Male Rap Solo Performance & Best Rap Song) and became the first rap song to win the Oscar for Best Original Song . Eminem didnâ€™t attend the ceremony as he didnâ€™t think heâ€™d win, meaning he didnâ€™t perform it, which is atypical for winners of the category. This was remedied when he performed the song at the 2020 Oscars .  The song has also had a huge cultural impact. Apple used the song for two commercials in the mid-â€˜00s to promote iTunes and the iPod, with Eminem featuring in the latter video. Chrysler used the instrumental and Eminem for their 2011 â€œBorn of Fireâ€ Super Bowl commercial. In 2021, Eminem opened up a restaurant in Detroit called â€œMomâ€™s Spaghettiâ€, which is a lyric thatâ€™s been memeâ€™d extensively (even being given its own fan-made song. ) Expand      +927     3  7   Share    Q&A Find answers to frequently asked questions about the song and explore its deeper meaning Ask a question Has "Lose Yourself" reached any milestones?  Genius Answer 