8115942028985,\"type\":\"user_attribution\"},{\"user\":1267225,\"pinnedRole\":null,\"attribution\":0.034782608695652174,\"type\":\"user_attribution\"},{\"user\":50988,\"pinnedRole\":null,\"attribution\":0.034782608695652174,\"type\":\"user_attribution\"},{\"user\":346807,\"pinnedRole\":null,\"attribution\":0.028985507246376812,\"type\":\"user_attribution\"},{\"user\":127862,\"pinnedRole\":null,\"attribution\":0.026086956521739132,\"type\":\"user_attribution\"},{\"user\":7995859,\"pinnedRole\":null,\"attribution\":0.011594202898550725,\"type\":\"user_attribution\"},{\"user\":1490398,\"pinnedRole\":null,\"attribution\":0.008695652173913044,\"type\":\"user_attribution\"}],\"acceptedBy\":8,\"currentUserMetadata\":{\"iqByAction\":{},\"interactions\":{\"vote\":null,\"pyong\":false,\"cosign\":false},\"excludedPermissions\":[\"vote\",\"edit\",\"cosign\",\"uncosign\",\"destroy\",\"accept\",\"reject\",\"see_unreviewed\",\"clear_votes\",\"propose_edit_to\",\"pin_to_profile\",\"unpin_from_profile\",\"update_source\",\"edit_custom_preview\",\"create_comment\"],\"permissions\":[]},\"votesTotal\":927,\"verified\":false,\"url\":\"https://genius.com/3489948/Eminem-lose-yourself/Lose-yourself\",\"twitterShareMessage\":\"â€œâ€œLose Yourselfâ€ is the theme song from Eminemâ€™s semi-biographical 2002 movie 8 Mile. Eminem is narratingâ€¦â€ â€”@Genius\",\"state\":\"accepted\",\"source\":null,\"shareUrl\":\"https://genius.com/3489948\",\"referentId\":3489948,\"pyongsCount\":7,\"proposedEditCount\":0,\"pinned\":false,\"needsExegesis\":false,\"id\":3489948,\"hasVoters\":true,\"embedContent\":\"<blockquote class=\'rg_standalone_container\' data-src=\'//genius.com/annotations/3489948/standalone_embed\'><a href=\'https://genius.com/3489948/Eminem-lose-yourself/Lose-yourself\'>Lose Yourself<\/a><br><a href=\'https://genius.com/Eminem-lose-yourself-lyrics\'>&#8213; Eminem â€“ Lose Yourself<\/a><\/blockquote><script async crossorigin src=\'//genius.com/annotations/load_standalone_embeds.js\'><\/script>\",\"deleted\":false,\"customPreview\":null,\"createdAt\":1267583121,\"community\":true,\"commentCount\":3,\"body\":{\"markdown\":\"\\\"Lose Yourself\\\" is the theme song from Eminem\'s semi-biographical 2002 movie *[8 Mile](http://genius.com/albums/Various-artists/Music-from-and-inspired-by-the-motion-picture-8-mile)*. Eminem is narrating the life of the film\'s protagonist, Jimmy, up until the third verse, where Jimmy and Eminem\'s journey converge.\\n\\nEngineer Steven King told *Rolling Stone* [in 2003](https://www.vgls.vic.gov.au/client/en_AU/vgls/search/detailnonmodal/eds:\$002f\$002f1657660369\$002f0\$002fazh\$007c\$007c15303517/ada/147dfac4-7ad0-4579-8819-8e2ff29dc5c7.Ujulbmo6f5\$002bZEYQ7Cf3SOTl\$002fq7NA4Wfb31Uu3nxmpvs\$003d?qu=Richman%2C+Daniel%2C+1939-&if=ee%09edsExpanderFacet%09fulltext&d=eds%3A%2F%2F1657660369%2F0%2Fazh%7C%7C15303517%7E1657660369%7E225&ic=true&te=1657660369&av=0&ps=300) that Eminem \\\"laid down all three verses in one take\\\", which Eminem has since [shed doubt on](http://genius.com/5140246).\\n\\nEminem stated in his 2008 autobiography, [*The Way I Am*](https://www.scribd.com/doc/94728297/The-Way-I-Am), that he wrote \\\"in-between shooting scenes [for *8 Mile*] and taking care of [his] kids\\\" (pg 108-109.) Scans of the scrawled lyrics on A4 writing pad pages were also featured in the autobiography (pg 217-218.)\\n\\nIn 2014, the [demo version](https://genius.com/Eminem-lose-yourself-original-demo-version-lyrics) appeared on Shady Records\' [*SHADY XV*](http://genius.com/albums/Shady-records/Shadyxv) compilation album, which featured the same beat and tone but almost entirely different lyrics.\\n\\nCommercially, \\\"Lose Yourself\\\" was hugely successful and reached #1 in 20 countries, including the US. It marked Eminem\'s first US #1, and held the top position for 12 weeks, becoming the third-longest chart-topper from a movie soundtrack (behind [\\\"I Will Always Love You\\\"](https://genius.com/Whitney-houston-i-will-always-love-you-lyrics) and [\\\"End Of The Road\\\"](https://genius.com/Boyz-ii-men-end-of-the-road-lyrics)). As of 2022, it is [13x Multi-Platinum](https://www.riaa.com/gold-platinum/?tab_active=default-award&ar=EMINEM&ti=LOSE+YOURSELF) in the US.\\n\\nThe song was lauded critically, too. It won [two Grammys](https://www.grammy.com/grammys/awards/46th-annual-grammy-awards) (Best Male Rap Solo Performance & Best Rap Song) and became the first rap song to win the Oscar for [Best Original Song](http://www.oscars.org/oscars/ceremonies/2003). Eminem didn\'t attend the ceremony as he [didn\'t think](https://youtu.be/qV4tG-3V3do?t=173) he\'d win, meaning he didn\'t perform it, which is atypical for winners of the category. This was [remedied](https://variety.com/2020/music/news/eminem-oscar-academy-awards-lose-yourself-exclusive-interview-1203500085/) when he performed the song at the [2020 Oscars](https://www.youtube.com/watch?v=Cbtgk20s6wA).\\n\\nThe song has also had a huge cultural impact. Apple used the song for [two commercials](https://appleinsider.com/articles/05/10/13/apple_pulls_new_eminem_ad_spot) in the mid-\'00s to promote iTunes and the iPod, with Eminem featuring in the latter video. Chrysler used the instrumental and Eminem for their 2011 [\\\"Born of Fire\\\"](https://www.youtube.com/watch?v=mYsFUFgOEmM) Super Bowl commercial. In 2021, Eminem opened up a restaurant in Detroit called â€œMomâ€™s Spaghettiâ€, which is a lyric that\'s been meme\'d extensively (even being given its [own fan-made song.](https://www.youtube.com/watch?v=SW-BU6keEUw))\",\"html\":\"<p>â€œLose Yourselfâ€ is the theme song from Eminemâ€™s semi-biographical 2002 movie <em><a href=\\\"https://genius.com/albums/Various-artists/Music-from-and-inspired-by-the-motion-picture-8-mile\\\" rel=\\\"noopener\\\" data-api_path=\\\"/albums/38300\\\">8 Mile<\/a><\/em>. Eminem is narrating the life of the filmâ€™s protagonist, Jimmy, up until the third verse, where Jimmy and Eminemâ€™s journey converge.<\/p>\\n\\n<p>Engineer Steven King told <em>Rolling Stone<\/em> <a href=\\\"https://www.vgls.vic.gov.au/client/en_AU/vgls/search/detailnonmodal/eds:%24002f%24002f1657660369%24002f0%24002fazh%24007c%24007c15303517/ada/147dfac4-7ad0-4579-8819-8e2ff29dc5c7.Ujulbmo6f5%24002bZEYQ7Cf3SOTl%24002fq7NA4Wfb31Uu3nxmpvs%24003d?qu=Richman%2C+Daniel%2C+1939-&amp;if=ee%09edsExpanderFacet%09fulltext&amp;d=eds%3A%2F%2F1657660369%2F0%2Fazh%7C%7C15303517%7E1657660369%7E225&amp;ic=true&amp;te=1657660369&amp;av=0&amp;ps=300\\\" rel=\\\"noopener nofollow\\\">in 2003<\/a> that Eminem â€œlaid down all three verses in one takeâ€, which Eminem has since <a href=\\\"https://genius.com/5140246\\\" rel=\\\"noopener\\\" data-api_path=\\\"/referents/5140245\\\">shed doubt on<\/a>.<\/p>\\n\\n<p>Eminem stated in his 2008 autobiography, <a href=\\\"https://www.scribd.com/doc/94728297/The-Way-I-Am\\\" rel=\\\"noopener nofollow\\\"><em>The Way I Am<\/em><\/a>, that he wrote â€œin-between shooting scenes [for <em>8 Mile<\/em>] and taking care of [his] kidsâ€ (pg 108-109.) Scans of the scrawled lyrics on A4 writing pad pages were also featured in the autobiography (pg 217-218.)<\/p>\\n\\n<p>In 2014, the <a href=\\\"https://genius.com/Eminem-lose-yourself-original-demo-version-lyrics\\\" rel=\\\"noopener\\\" data-api_path=\\\"/songs/586290\\\">demo version<\/a> appeared on Shady Records\' <a href=\\\"https://genius.com/albums/Shady-records/Shadyxv\\\" rel=\\\"noopener\\\" data-api_path=\\\"/albums/114275\\\"><em>SHADY XV<\/em><\/a> compilation album, which featured the same beat and tone but almost entirely different lyrics.<\/p>\\n\\n<p>Commercially, â€œLose Yourselfâ€ was hugely successful and reached #1 in 20 countries, including the US. It marked Eminemâ€™s first US #1, and held the top position for 12 weeks, becoming the third-longest chart-topper from a movie soundtrack (behind <a href=\\\"https://genius.com/Whitney-houston-i-will-always-love-you-lyrics\\\" rel=\\\"noopener\\\" data-api_path=\\\"/songs/329470\\\">â€œI Will Always Love Youâ€<\/a> and <a href=\\\"https://genius.com/Boyz-ii-men-end-of-the-road-lyrics\\\" rel=\\\"noopener\\\" data-api_path=\\\"/songs/51652\\\">â€œEnd Of The Roadâ€<\/a>). As of 2022, it is <a href=\\\"https://www.riaa.com/gold-platinum/?tab_active=default-award&amp;ar=EMINEM&amp;ti=LOSE+YOURSELF\\\" rel=\\\"noopener nofollow\\\">13x Multi-Platinum<\/a> in the US.<\/p>\\n\\n<p>The song was lauded critically, too. It won <a href=\\\"https://www.grammy.com/grammys/awards/46th-annual-grammy-awards\\\" rel=\\\"noopener nofollow\\\">two Grammys<\/a> (Best Male Rap Solo Performance &amp; Best Rap Song) and became the first rap song to win the Oscar for <a href=\\\"http://www.oscars.org/oscars/ceremonies/2003\\\" rel=\\\"noopener nofollow\\\">Best Original Song<\/a>. Eminem didnâ€™t attend the ceremony as he <a href=\\\"https://youtu.be/qV4tG-3V3do?t=173\\\" rel=\\\"noopener nofollow\\\">didnâ€™t think<\/a> heâ€™d win, meaning he didnâ€™t perform it, which is atypical for winners of the category. This was <a href=\\\"https://variety.com/2020/music/news/eminem-oscar-academy-awards-lose-yourself-exclusive-interview-1203500085/\\\" rel=\\\"noopener nofollow\\\">remedied<\/a> when he performed the song at the <a href=\\\"https://www.youtube.com/watch?v=Cbtgk20s6wA\\\" rel=\\\"noopener nofollow\\\">2020 Oscars<\/a>.<\/p>\\n\\n<p>The song has also had a huge cultural impact. Apple used the song for <a href=\\\"https://appleinsider.com/articles/05/10/13/apple_pulls_new_eminem_ad_spot\\\" rel=\\\"noopener nofollow\\\">two commercials<\/a> in the mid-â€˜00s to promote iTunes and the iPod, with Eminem featuring in the latter video. Chrysler used the instrumental and Eminem for their 2011 <a href=\\\"https://www.youtube.com/watch?v=mYsFUFgOEmM\\\" rel=\\\"noopener nofollow\\\">â€œBorn of Fireâ€<\/a> Super Bowl commercial. In 2021, Eminem opened up a restaurant in Detroit called â€œMomâ€™s Spaghettiâ€, which is a lyric thatâ€™s been memeâ€™d extensively (even being given its <a href=\\\"https://www.youtube.com/watch?v=SW-BU6keEUw\\\" rel=\\\"noopener nofollow\\\">own fan-made song.<\/a>)<\/p>\"},\"beingCreated\":false,\"apiPath\":\"/annotations/3489948\",\"type\":\"annotation\"}},\"referents\":{\"8078\":{\"classification\":\"accepted\",\"editorialState\":\"accepted\",\"id\":8078},\"10562\":{\"classification\":\"accepted\",\"editorialState\":\"accepted\",\"id\":10562},\"10563\":{\"classification\":\"accepted\",\"editorialState\":\"accepted\",\"id\":10563},\"11369\":{\"classification\":\"accepted\",\"editorialState\":\"accepted\",\"id\":11369},\"11455\":{\"classification\":\"verified\",\"editorialState\":\"accepted\",\"id\":11455},\"12217\":{\"classification\":\"accepted\",\"editorialState\":\"accepted\",\"id\":12217},\"14661\":{\"classification\":\"accepted\",\"editorialState\":\"accepted\",\"id\":14661},\"14669\":{\"classification\":\"accepted\",\"editorialState\":\"accepted\",\"id\":14669},\"16147\":{\"classification\":\"accepted\",\"editorialState\":\"accepted\",\"id\":16147},\"16148\":{\"classification\":\"accepted\",\"editorialState\":\"accepted\",\"id\":16148},\"18960\":{\"classification\":\"accepted\",\"editorialState\":\"accepted\",\"id\":18960},\"18967\":{\"classification\":\"accepted\",\"editorialState\":\"accepted\",\"id\":18967},\"18968\":{\"classification\":\"accepted\",\"editorialState\":\"accepted\",\"id\":18968},\"32910\":{\"classification\":\"accepted\",\"editorialState\":\"accepted\",\"id\":32910},\"32911\":{\"classification\":\"accepted\",\"editorialState\":\"accepted\",\"id\":32911},\"41203\":{\"classification\":\"accepted\",\"editorialState\":\"accepted\",\"id\":41203},\"42545\":{\"classification\":\"verified\",\"editorialState\":\"accepted\",\"id\":42545},\"43404\":{\"classification\":\"accepted\",\"editorialState\":\"accepted\",\"id\":43404},\"43405\":{\"classification\":\"accepted\",\"editorialState\":\"accepted\",\"id\":43405},\"43407\":{\"classification\":\"accepted\",\"editorialState\